text:
{'text': "Enjoyed my 11 am Duck tour on the DUKW Katrina on Sat 22 Feb 2025. The tour departed on time for the waterborne part before returning to land for the landward section.

Our guide was very nice and took the initiative a few times to go around snapping pictures for Duck Tour participants. Bonus points for the free Duck stickers if you answered the trivia questions correctly. Captain Tan maneuvered our DUKW Katrina very well, so much that there wasn't any water splashing onto participants when we entered the water at Marina Barrage.

Fulfilled a childhood dream today thanks to Duck Tours", 'languageCode': 'en'}

